import React, { Component } from 'react'

import Projectors from "../components/ProjectorsList"

export default class Inventory extends Component {

    render() {
        
        return (
          <>
            <div className="grid-container">
              <div className="card">
                <div className="card-section">
                  <Projectors />
                </div>
              </div>
            </div>
                
            <div className="card">
              <div className="card-section">
                <Projectors />
              </div>
            </div>
          </>
        );
    }
}
